import arrow from '../images/arrow.png';

const Homepage = () => (
  <div className="flex items-center justify-center leading-none w-full h-full p-12 sm:p-8 homepage-title">
    <div className="block">
      <h1 className="homepage-text">stephanie harris</h1>
      <h1 className="homepage-text">& victor ma</h1>
      <h2 className="homepage-subtext">the foundry,</h2>
      <h2 className="homepage-subtext2">long island city - new york</h2>
    </div>
  </div>
);

export default Homepage;


/*

